import React from "react";



function SocialItem(prop) {

    return(

        <li className="list-group-item">
            <img src={prop.img} />
            <input type="checkbox" id={prop.media}/>
            <label for={prop.media}>{prop.media}</label>
            </li>
            
    )

}

export default SocialItem
